import React from 'react';

const CrudTable = () => {
    return (
        <div>
            <h3>Tabla de datos</h3>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Short</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>1</td>
                        <td>Binance Smart</td>
                        <td>BNB</td>
                        <td><button>Editar</button><button>Eliminar</button></td>
                    </tr>
                </tbody> 
            </table>
        </div>
    );
};

export default CrudTable;
